import { BrowserRouter as Router, Routes, Route, Navigate, Link } from 'react-router-dom';
import Playlists from './Javascript/Playlists';
import App from './Javascript/App';
import AuthWrapper from './AuthWrapper';

function MainRouter() {
  return (
    <Router>
      <AuthWrapper>
        <nav style={{padding: '0.5rem 1rem', background: '#f5f5f5', marginBottom: 0, borderBottom: '1px solid #ddd'}}>
          <Link to="/home" style={{marginRight: 20, textDecoration: 'none', color: '#333'}}>Jammming</Link>
          <Link to="/playlists" style={{textDecoration: 'none', color: '#333'}}>Playlists</Link>
        </nav>
        <Routes>
          <Route path="/home" element={<App />} />
          <Route path="/jammming" element={<App />} />
          <Route path="/playlists" element={<Playlists />} />
          <Route path="/" element={<Navigate to="/home" replace />} />
        </Routes>
      </AuthWrapper>
    </Router>
  );
}

export default MainRouter;
